    "# Compare summary stat for ridership based on customer type and broken down by day of the week\n",
    "bike_data %>% \n",
    "  group_by(customer_type, day_of_week) %>% \n",
    "  summarise(total_rides = n(), average_rides = mean(ride_length), .groups = 'drop') %>% \n",
    "  arrange(day_of_week)"
   ]
