    "# Figure 5: Ridership Breakdown by Bike Type\n",
    "bike_data %>% \n",
    "  group_by(customer_type) %>%\n",
    "  ggplot(aes(x = bike_type, fill = customer_type)) + geom_bar(position = \"dodge\") +\n",
